demo.repl.help:
Pieejamās komandas:
  @show              ─ parādīt pēdējās adaptīvās kartes kopsavilkumu
  @json              ─ izvadīt neapstrādāto JSON vērtību, kas saņemta no plūsmas
  @back              ─ atgriezties pie iepriekšējās bloķētās kartes/ievadēm
  @input <k>=<v>     ─ iestatīt vai pārrakstīt ievades lauku
  @click <action_id> ─ iesniegt karti ar norādīto darbību
  @help              ─ izdrukāt šo palīdzības tekstu
  @quit              ─ iziet no REPL
